import NavItem from './NavItem';

const Nav = () => {
    return(
        <nav>
            <ul>
                <NavItem url={'/'} linkName={'Home'}/>
                <NavItem url={'/posts'} linkName={'Posts'}/>
                <NavItem url={'/contact'} linkName={'Contact'}/>
                <NavItem url={'/about'} linkName={'About'}/>
            </ul>
        </nav>
    )
}


export default Nav;
